import { Jumbotron, Button } from "react-bootstrap";
import Header from "../commons/Header/Header";
import Footer from "../commons/Footer/Footer";


function About(props) {
  console.log(props.test)
  return (
    <>

      <Header />
      <Jumbotron>
        <h3>About</h3>
        <p>
          This is Stoyan's first project with ReactJS assigned by Softuni Sofia. The mission of this website is to provide some information about heroes from the Star Wars Movies 
        </p>
        <p>
          <Button preventDefault variant="primary" href="/mainPage/MainPage">Go back</Button>
        </p>
      </Jumbotron>
      <Footer />
    </>
  );
}

export default About;
